class Solution {

    /**
     * @param String[][] $orders
     * @return String[][]
     */
    function displayTable($orders) {
        $foods = $tables = $data = [];
        for ($i=0; $i < count($orders); $i++) {
            if (!in_array($orders[$i][1], $tables)) $tables[] = $orders[$i][1];
            if (!in_array($orders[$i][2], $foods)) $foods[] = $orders[$i][2];
            $data[] = $orders[$i][1] .'-'. $orders[$i][2];
        }
        $table_food = array_count_values($data);
        sort($foods);
        sort($tables);
        $result = [];
        for ($i=0; $i < count($tables); $i++) {
            $tableId = $tables[$i];
            $temp = [];
            for ($j=0; $j < count($foods); $j++) {
                $food = $foods[$j];
                $temp[$j] = $table_food[$tableId.'-'.$food] ? (string)$table_food[$tableId.'-'.$food] : '0' ;
            }
            array_unshift($temp, $tableId);
            $result[] = $temp;
        }
        array_unshift($foods, 'Table');
        array_unshift($result, $foods);
        return $result;
    }

