    // 版本一

    /**
     * @param String[][] $orders
     * @return String[][]
     */
    function displayTable1($orders) {
        $data = [];
        for ($i=0; $i < count($orders); $i++) {
            $data[$i]['table'] = $orders[$i][1];
            $data[$i]['food'] = $orders[$i][2];
        }
        $foods = array_unique(array_column($data, 'food'));
        sort($foods);
        $tables = array_unique(array_column($data, 'table'));
        sort($tables);
        $result = [];
        for ($i=0; $i < count($tables); $i++) {
            $tableId = $tables[$i];
            $temp = [];
            for ($j=0; $j < count($foods); $j++) {
                $food = $foods[$j];
                $temp[$j] = $this->deep($data, $tableId, $food);
            }
            array_unshift($temp, $tableId);
            $result[] = $temp;
        }
        array_unshift($foods, 'Table');
        array_unshift($result, $foods);
        return $result;
    }

    function deep1($data, $tableid, $food){
        $num = 0;
        for ($i=0; $i < count($data); $i++) if ($data[$i]['table'] == $tableid && $data[$i]['food'] == $food) $num += 1;
        return (string)$num;
    }
}

